import React, { Component } from 'react';
import {Footer} from '../components/footer.js';

export class Partners extends Component {
    state = {  }

    styles = {
        header: {
            color: 'red',
            fontSize: 35
        },
        subheader: {
            color: 'red',
            fontSize: 25
        },
        bold: {
            fontWeight: 'bold'
        },
        blue: {
            color: '#1cb7e6',
            fontSize: 50
        }
    }

    render() { 
        return (
            <React.Fragment>
            <div class="container border border-grey">
                <div class="col-lg">
                    <h1 class="heading" style={this.styles.header}>PARTNERS</h1>
                </div>
                <div class="col">
                    <img src={require("../images/overheard-bubble-partners.jpg")} alt="partners_image"/>
                </div>
            </div>
            <Footer/>
            </React.Fragment>
        );
    }
}
